import React from "react";

export default function Login(){
    return(
        <div>
            <label>E-mail</label>
            <input type="text" name="email"></input>
            <label>Password</label>
            <input type="password"></input>
            <button type="submit" onClick={login}></button>
        </div>
    )
}
